import React from "react";
import { NavLink } from "react-router-dom";

const menu = () => {
  return (
    <div>
      <NavLink to="/loginadmin">
        <li>Admin</li>
      </NavLink>
      <NavLink to="/loginemploye">
        <li>Employe</li>
      </NavLink>
      <NavLink to="/proforma">
        <li>Proforma</li>
      </NavLink>
      <NavLink to="/listdemandeproforma">
        <li>list demande proforma</li>
      </NavLink>
      <NavLink to="/vente">
        <li>Vente</li>
      </NavLink>
      <NavLink to="/listdemandeproformabdc">
        <li>bon de commande</li>
      </NavLink>
    </div>
  );
};

export default menu;
